import React from 'react'
import ReactDOM from 'react-dom'
import './react-video-gallery.css'
import {VideoCategoryCard} from './react-video-category-card'

class VideoGallery extends React.Component
{
    constructor(props)
    {
        this.state = {
            shownCategory: null
        }
    }
    render()
    {
        return(
        <div id="gallery" >
            <h1 id="gallery-title">{props.galleryTitle}</h1>
            <VideoCategoryCard
            url="https://www.youtube.com/embed/C0RFDUYM1xQ" />
        </div>
    )
    }
}

export {VideoGallery}
